  static Img8u load_image_data(icl8u data[32][32][4]){
    // {{{ open

  Img8u image(Size(32,32),4);
  Channel8u cs[4];
  image.extractChannels(cs);
  for(int x=0;x<image.getWidth();++x){
    for(int y=0;y<image.getHeight();++y){
      cs[0](x,y) = data[x][y][0];
      cs[1](x,y) = data[x][y][1];
      cs[2](x,y) = data[x][y][2];
      cs[3](x,y) = data[x][y][3];
    }
  }
  return image;
}

